import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

<div id="root"></div>

function Clock(props) {
    return (
        <div>
            <h1>Hello, Andre</h1>
            <h2>It is {props.date.toLocaleString()}.</h2>
        </div>
    );
}


    function tick() {
        ReactDOM.render(
            <Clock date={new Date()}/>,
            document.getElementById('root')
        );
    }

    setInterval(tick, 1000);
